import Slider from 'react-slick'
import styles from './styles.module.css'

function get_item(obj, key) {
	console.log(obj)
	return <h1 key={key}>{obj["full-name"]}</h1>
}

function Team(props) {
	const  slideCards = [
		{
			'full-name': "Алеша попович"
		},
		{	
			'full-name': "Никита Васин"
		},
		{
			'full-name': "Алексей Васькин"
		}
	]

	const sliderConfigs = {
		slidesToShow: 1,
    	slidesToScroll: 1,
    	infinite: false,
    	arrows: true
	}
	return 
		<div className={styles.slider}>
			<Slider {...sliderConfigs}>
				{slideCards.map(get_item)}
			</Slider>
		</div>
		

}

export default Team
